INSERT INTO `jtc_movies` VALUES (1,'Badrinath Ki Dulhania','2017-03-24','/static/jtc/img/bg_badri.jpg','/static/jtc/img/menu_badri.jpg','/static/jtc/img/poster_badri.jpg','','https://www.youtube.com/watch?v=ztX-iGlZ_Ug&t=50s',6,'Badrinath Bansal from Jhansi and Vaidehi Trivedi from Kota belong to small towns but have diametrically opposite opinions on everything. This leads to a clash of ideologies, despite both of them recognizing the goodness in each other.'),(2,'Begum Jaan','2017-04-14','/static/jtc/img/bg_begum.jpg','/static/jtc/img/menu_begum.jpg','/static/jtc/img/poster_begum.jpg','','https://www.youtube.com/watch?v=rhmT2nfc6ko&t=15s',8,'The story of eleven prostitutes who refuse to part ways with their brothel and each other during the partition between India and Pakistan.'),(3,'Bahubali 2: The Conclusion','2017-04-28','/static/jtc/img/bg_bahubali.jpg','/static/jtc/img/menu_bahubali.jpg','/static/jtc/img/poster_bahubali.jpg','','https://www.youtube.com/watch?v=G62HrubdD6o&t=9s',8,'When Shiva, the son of Bahubali, learns about his heritage, he begins to look for answers. His story is juxtaposed with past events that unfolded in the Mahishmati Kingdom.'),(4,'Deadpool2','2018-03-12','/static/jtc/img/bg_deadpool.jpg','/static/jtc/img/menu_deadpool.jpg','/static/jtc/img/poster_deadpool.jpg','','https://www.youtube.com/watch?v=wLeGWcVeIZ4',0,'Movie in-Production'),(5,'Phillauri','2017-03-24','/static/jtc/img/bg_phillauri.jpg','/static/jtc/img/menu_phillauri.jpg','/static/jtc/img/poster_phillauri.jpg','','https://www.youtube.com/watch?v=uCTr7MGFK0U',6,'A man must marry a tree to ward off threats to his love-life, but the tree turns out to have more spirit than the man bargained for.'),(6,'The Boss Baby','2017-03-31','/static/jtc/img/bg_bossbaby.jpg','/static/jtc/img/menu_bossbaby.jpg','/static/jtc/img/poster_bossbaby.jpg','','https://www.youtube.com/watch?v=h24gEn3y82Q',6,'A suit-wearing briefcase-carrying baby pairs up with his seven-year old brother to stop the dastardly plot of the CEO of Puppy Co.'),(7,'Naam Shabana','2017-04-07','/static/jtc/img/bg_shabana.jpg','/static/jtc/img/menu_shabana.jpg','/static/jtc/img/poster_shabana.jpg','','https://www.youtube.com/watch?v=upyeAQv4pUs',7,'In this spin-off from the 2015 movie Baby, we learn more about secret agent Shabana, played by Tapsee Pannu.'),(8,'The Fate of the Furious','2017-04-14','/static/jtc/img/bg_fate.jpg','/static/jtc/img/menu_fate.jpg','/static/jtc/img/poster_fate.jpg','','https://www.youtube.com/watch?v=jeKBMdYaM3U',7,'When a mysterious woman seduces Dom into the world of terrorism and a betrayal of those closest to him, the crew face trials that will test them as never before.'),(9,'Noor','2017-04-21','/static/jtc/img/bg_noor.jpg','/static/jtc/img/menu_noor.jpg','/static/jtc/img/poster_noor.jpg','','https://www.youtube.com/watch?v=DHuM6C6EyXE&t=26s',6,'Noor is a journalist who juggles her work, love and personal life on a day-to-day basis. One day, Noor\'s life takes a dramatic turn when she comes across an eye-opening investigative news story.'),(10,'Laali Ki Shaadi Mein Laaddoo Deewana','2017-04-07','/static/jtc/img/bg_lalli.jpg','/static/jtc/img/menu_lalli.jpg','/static/jtc/img/poster_laali.jpg','','https://www.youtube.com/watch?v=gLEHU6If0XY',5,'Laali and Ladoo get trapped in a royal wedding that takes place in Vadodara.');
