INSERT INTO `jtc_star` VALUES (1,'Varun Dhawan','/static/jtc/img/actor_varun.jpg','Actor','Varun Dhawan is an actor and assistant director, known for Badlapur(2015),Humpty sharma ki Dulhania.'),(2,'Prabhas','/static/jtc/img/actor_prabhas.jpg','Actor','Prabhas was born to late U. Suryanarayana Raju and Siva Kumari. His family is from Mogalturu village and later moved to bhimavaram in West Godavari district, Andhra Pradesh. He is the youngest of three children, with an elder brother Pramod Uppalapati and sister Pragathi. He is the nephew of Telugu actor Uppalapati Krishnam Raju'),(3,'Vidya Balan','/static/jtc/img/actress_vidya.jpg','Actress','Vidya was born in Palghat, Kerala, India. Her family consists of her dad, P.R. Balan, who is the Vice-President of ETC Channel; mom - a home-maker, and an elder sister, Priya, who is married to Kedar. She also has an aunt by the name of Raji Raju.\r\n\r\nThe Balan family re-located to live at Road No. 11, near Ambedkar Garden, Chembur, Bombay, when Vidya was very young. She studied in St. Anthony\'s Convent School, and thereafter in St. Xavier\'s College from where she obtained a degree in Sociology. She then went on to obtain a Masters degree in Sociology from Bombay University.'),(4,'Ryan Reynolds','/static/jtc/img/actor_ryan.jpg','Actor','Ryan Rodney Reynolds was born on October 23, 1976 in Vancouver, British Columbia, Canada, the youngest of four children. His father, James Chester Reynolds, was a food wholesaler, and his mother, Tammy, worked as a retail-store saleswoman. Between 1991-93, Ryan appeared in Fifteen (1990), a Nickleodeon series taped in Florida with many other Canadian actors. After the series ended, he returned to Vancouver where he played in a series of forgettable television movies. He did small roles in Glenn Close\'s Serving in Silence: The Margarethe Cammermeyer Story (1995) and CBS\'s update of In Cold Blood (1996). However, his run of luck had led him to decide to quit acting.\r\n\r\nOne night, he ran into fellow Vancouver actor and native Chris William Martin. Martin found Ryan rather despondent and told him to pack everything: they were going to head to Los Angeles, California. The two stayed in a cheap Los Angeles motel. On the first night of their stay, Reynolds\' jeep was rolled downhill and stripped. For the next four months, Ryan drove it without doors. In 1997, he landed the role of Berg in Two Guys, a Girl and a Pizza Place (1998). Initially, the show was reviled by critics and seemed desperate for any type of ratings success. However, it was renewed for a second season but with a provision for a makeover by former Roseanne (1988) writer Kevin Abbott. The show became a minor success and has led to additional film roles for Ryan, most notably in the last-ever MGM film, a remake of The Amityville Horror (2005). Ryan was engaged to Canadian singer-songwriter Alanis Morissette, another Nickelodeon veteran, between 2004-2006.\r\n\r\nHe has been married to Blake Lively since September 9, 2012. They have two children. He was previous married to Scarlett Johansson.'),(5,'Anushka Shrama','/static/jtc/img/actress_anushka.jpg','Actress','Anushka Sharma was born on 1 May 1988 in Ayodhya, Uttar Pradesh. Her father, Colonel Ajay Kumar Sharma, is an army officer, and her mother, Ashima Sharma, is a homemaker. Her father is a native of Uttar Pradesh, while her mother is a Garhwali. Her elder brother is film producer Karnesh Sharma, who earlier served in the Merchant Navy. Prior to joining the navy, Karnesh played for the under-19 Bangalore Ranji cricket team. Sharma has stated that being a military brat played an important role in shaping her as a person and contributing to her life. In an interview with The Times of India in 2012, she said, \"I take pride in saying that I am an army officer\'s daughter even more than being an actor. She studied in Army School and graduated with specialization in arts from Mount Carmel College, Bangalore. She then moved to Mumbai to further her modeling career. Sharma says she originally wished to make it big in the modeling world but had no strong aspirations for films. She began her modeling career at the Lakme Fashion Week as a model for Wendell Rodricks\'s Les Vamps Show and was picked to be Rodricks\'s finale model at the Spring Summer \'07 Collection. Since then she has done campaigns for Silk & Shine, Whisper, Nathella Jewelry and Fiat Palio.\r\n\r\nHer first acting role was in Aditya Chopra\'s Rab Ne Bana Di Jodi (2008) opposite Shahrukh Khan. The film was a huge success and her performance was appreciated. Film critic Taran Adarsh said, \"Anushka looks the character and surprises you with a confident performance. It\'s no small achievement to share screen space with an actor of the caliber of SRK and Anushka manages it very well from start to end.\" Her second film, Badmaash Company, also under Yash Raj Films, was released on May 7, 2010. She was praised for breaking out of the shell of the conservative and homely Taani to play the feisty and independent Bulbul, and her performance was applauded.\r\n\r\nShe has two other projects on hand. She began shooting for her first venture outside of Yash Raj with Nikhil Advani and Akshay Kumar in Patiala House in December 2009. Patiala House is scheduled to be released on February 11, 2011. She has also started filming for her third Yash Raj Film, Band Baaja Baaraat, directed by Maneesh Sharma and co-starring debutant Ranveer Singh.'),(6,'Alec Baldwin','/static/jtc/img/actor_alec.jpg','Actor','Raven-haired, suavely handsome and prolific actor Alec Baldwin was born on April 3, 1958 in Massapequa, New York, and is the oldest, and easily the best-known, of the four Baldwin brothers in the acting business (the others are Stephen Baldwin, William Baldwin and Daniel Baldwin).\r\n\r\nAlexander Rae Baldwin III is the son of Carol Newcomb (Martineau) and Alexander Rae Baldwin, Jr., who was a high school teacher and football coach. He is of English, Irish, French, Scottish, and German descent.\r\n\r\nAlec burst onto the TV scene in the early 1980s with appearances on several series, including The Doctors (1963) and Knots Landing (1979), before scoring feature film roles in Forever, Lulu (1987), Beetlejuice (1988), Working Girl (1988), Married to the Mob (1988) and Talk Radio (1988). In 1990, Baldwin appeared in the first on-screen adaptation of the \"Jack Ryan\" character created by mega-selling espionage author, Tom Clancy. The film, The Hunt for Red October (1990), was a box office and critical success, with Baldwin appearing alongside icy Sean Connery. Unfortunately, Baldwin fell out with Paramount Studios over future scripts for \"Jack Ryan\", and subsequent Ryan roles went to Harrison Ford.\r\n\r\nBaldwin instead went to Broadway to perform \"A Streetcar Named Desire\", garnering a Tony nomination for his portrayal of \"Stanley Kowalski\" (he would reprise the role in a 1995 TV adaptation). Baldwin won over critics as a lowlife thief pursued by dogged cop Fred Ward in Miami Blues (1990), met his future wife Kim Basinger while filming the Neil Simon comedy, The Marrying Man (1991), starred in the film adaptation of the play, Prelude to a Kiss (1992) (in which he starred off-Broadway), and made an indelible ten-minute cameo as a hard-nosed real estate executive laying down the law in Glengarry Glen Ross (1992). He also made a similar tour-de-force monologue in the thriller, Malice (1993), as a doctor defending his practices, in which he stated, \"Let me tell you something: I am God\".'),(7,'Tobey Maguire','/static/jtc/img/actor_toby.jpg','Actor','Tobias Vincent Maguire was born in Santa Monica, California. His parents were 18 and 20, and not yet married, when he was born. His mother, Wendy (Brown), did advertising, publicity, and acting in Hollywood for years as she coached and managed Tobey. His father, Vincent Maguire, was a cook and sometimes a construction worker. Tobey did not finish high school in order to pursue and focus on acting roles, but he did end up getting his GED. He did several commercials (he was a model dancer for Nordstrom by age six), and he had some roles on various TV shows before landing a starring role on the Fox comedy Great Scott! (1992). That role lasted nine weeks before the show was canceled. Fox-made series were not doing well in general at the time. He avoids drugs and alcohol, and his best friend is Leonardo DiCaprio. Tobey is a vegan and studies yoga. He now has two beautiful children with his wife Jennifer Meyer Maguire. Their names are Ruby Sweetheart and Otis Tobias Maguire. Another little known fact is that his two half-brothers, Jopaul and Weston Epp, were the child actors who handed Tobey (Peter Parker) his mask after the train scene in Spider-Man 2.'),(8,'Tapsee Pannu','/static/jtc/img/actress_tapsee.jpg','Actress','Tapsee Pannu was born on August 1, 1987 in Delhi, India. She is an actress, known for Pink (2016), Naam Shabana (2017) and Baby (2015).\r\nTaapsee was a participant in Miss India 2008 pageant and won the Pantaloons Femina Miss Fresh Face titles.\r\nTaapsee was a participant in Miss India 2008 pageant and won the Safi Femina Miss Beautiful Skin titles.'),(9,'Manoj Bajpayee','/static/jtc/img/actor_manoj.jpg','Actor','Manoj Bajpayee was born on April 23, 1969 in Belwa, Bihar, India. He is known for his work on Gangs of Wasseypur (2012), Special 26 (2013) and Veer-Zaara (2004). He has been married to Neha since February 23, 2005.Two time winner of prestigious national film awards of India. for best actor and best supporting actor for Pinjar (2003) and Satya (1999).\r\nWas the first choice for the role of Thambe ( Sambha) in Ram Gopal Varma Ki Aag.\r\nWas the first choice for Saif Ali Khan\'s role in Love Ke Liye Kuch Bhi Karega.\r\nRefused Jackie Shroff \'s role in Devdas.\r\nStarred in the shelved film \" Dharti\" opposite Rani Mukherjee.\r\nStarred in shelved film N.S. Films International\" Paanchi\". (2001) Starring Manoj Bajpai,Mahima Chaudhary, Shamita Shetty ,(Replaced Punarnava ),Bikram Saluja, Sharad Kapoor, Biswajeet,Vaarun Vaardhan,Malay Chakraborty,Brijesh Hirjee,Ehsan Khan,Music by Rajesh Roshan, Produced by Yatinder Singhal, Directed by Parto Ghosh.\r\nStarred in Ajay Devgan Production\'s shelved film \" Barf\" opposite Sushmita Sen. Directed by Vishal Bharadwaj.\r\nStarred in Neeraj Pathak\'s shelved film \" Maati\". Co starring Fardeen Kham and Mahima Chaudhary.\r\nStarred in Padmalaya Production shelved film opposite Akanksha Malhotra ( Prem Nath granddaughter).\r\nStarred in Ravi Diwan\'s shelved film \" Syaah - A Walk on The Dark Side\" co starring Bipasha Basu.\r\nHis parents named him after Superstar Legend Manoj Kumar.\r\nStarred in Hansal Mehta\'s shelved film Netwa opposite wife Neha.\r\nStarred in the shelved Indo/French film \" All Alone\" opposite Miss World 1997, Diana Hayden. Co starring Nigar Khan, Bikram Saluja. The film was based on the Independence of Mauratius in 1968. The film was to be directed by Ritesh Batra. The film was shelved due to problems with the producer\'s.\r\nStarred in E Niwas\' s shelved film opposite Raveena Tandon , co starring Fardeen Khan. This was in 2002.\r\nStarred in Partho Gosh\' s untitled movie that was shelved. Co starring Shilpa Shetty, Milind Soman, Isha Khoppikar, Amar Upadhyay. This was on 2004.'),(10,'Dwayne Johnson','/static/jtc/img/actor_rock.jpg','Actor','Dwayne Douglas Johnson, also known as The Rock, was born on May 2, 1972 in Hayward, California, to Ata Johnson (born Feagaimaleata Fitisemanu Maivia) and Canadian-born professional wrestler Rocky Johnson (born Wayde Douglas Bowles). His father is black (of Black Nova Scotian descent), and his mother is of Samoan background (her own father was Peter Fanene Maivia, also a professional wrestler). While growing up, Dwayne traveled around a lot with his parents and watched his father perform in the ring. During his high school years, Dwayne began playing football and he soon received a full scholarship from the University of Miami where he had tremendous success as a football player. In 1995, Dwayne suffered a back injury which cost him a place in the NFL. He then signed a 3 year deal with the Canadian League but left after a year to pursue a career in wrestling. He made his wrestling debut in the USWA under the name Flex Kavanah where he won the tag team championship with Brett Sawyer. In 1996, Dwayne joined the WWE and became Rocky Maivia where he joined a group known as \"The Nation of Domination\" and turned heel. Rocky eventually took over leadership of the \"Nation\" and began taking the persona of The Rock. After the \"Nation\" split, The Rock joined another elite group of wrestlers known as the \"Corporation\" and began a memorable feud with Steve Austin. Soon the Rock was kicked out of the \"Corporation\". He turned face and became known as \"The Peoples Champion\". In 2000, the Rock took time off from WWE to film his appearance in The Mummy Returns (2001). He returned in 2001 during the WCW/ECW invasion where he joined a team of WWE wrestlers at The Scorpion King (2002), a prequel to The Mummy Returns (2001).\r\n\r\nDwayne has a daughter, Simone Alexandra, born in 2001, with his ex-wife Dany Garcia.'),(11,'Vin Diesel','/static/jtc/img/actor_vin.jpg','Actor','Vin Diesel was born Mark Sinclair in Alameda County, California, along with his fraternal twin brother, Paul Vincent. He was raised by his astrologer/psychologist mother, Delora Sherleen (Sinclair), and adoptive father, Irving H. Vincent, an acting instructor and theater manager, in an artist\'s housing project in New York City\'s Greenwich Village. He never knew his biological father. His mother is white (with English, German, Scottish, and Irish ancestry), and his adoptive father is African-American; referring to his biological father\'s background, Diesel has said that he himself is \"definitely a person of colour\".\r\n\r\nHis first break in acting happened by chance, when at the age of seven he and his friends broke into a theatre to vandalize it. A woman stopped them and offered them each a script and $20, on the condition that they would attend everyday after school. From there, Vin\'s fledgling career progressed from the New York repertory company run by his father, to the Off-Off-Broadway circuit. At age seventeen and already sporting a well-honed physique, he became a bouncer at some of New York\'s hippest clubs to earn himself some extra cash. It was at this time that he changed his name to Vin Diesel.\r\n\r\nFollowing high school, Vin enrolled as an English major at Hunter College, but dropped out after three years to go to Hollywood to further his acting career. Being an experienced theatre actor did not make any impression in Hollywood and after a year of struggling to make his mark, he returned to New York. His mother then gave him a book called \"Feature Films at used Car Prices\" by Rick Schmidt. The book showed him that he could take control of his career and make his own movies. He wrote a short film based on his own experiences as an actor, called Multi-Facial (1995), which was shot in less than three days at a cost of $3,000. Multi-Facial (1995) was eventually accepted for the 1995 Cannes Film Festival where it got a tumultuous reception.\r\n\r\nAfterwards, Vin returned to Los Angeles and raised almost $50,000 through telemarketing to fund the making of his first feature, Strays (1997). Six months after shooting, the film was accepted for the 1997 Sundance Film Festival, and although it received a good reception, it did not sell as well as hoped. Yet again Vin returned disappointed to New York only to receive a dream phone call. Steven Spielberg was impressed by Multi-Facial (1995) and wanted to meet Vin, leading him to be cast in Saving Private Ryan (1998). Multi-Facial (1995) earned Vin more work, when the director of The Iron Giant (1999) saw it and decided to cast Vin in the title role. From there, Vin\'s career has steadily grown, with him securing his first lead role as Richard B. Riddick in the sci-fi film Pitch Black (2000). The role has earned him a legion of devoted fans and the public recognition he deserves.\r\n\r\nSince then, he has headlined a series of blockbusters, often but not only centered on fast-driving motor vehicles: The Fast and the Furious (2001), xXx (2002), The Pacifier (2005), Fast & Furious (2009), Fast Five (2011), Fast & Furious 6 (2013), and Furious 7 (2015). He also voiced Groot in Guardians of the Galaxy (2014) and starred in the lower-budgeted courtroom drama Find Me Guilty (2006), the latter directed by Sidney Lumet.'),(12,'Sonakshi Sinha','/static/jtc/img/actress_sonakshi.jpg','Actress','She is the daughter of legendary Indian actor Shatrughan Sinha and Poonam Sinha and sister to Luv Sinha and Kussh Sinha. She started her career as a model and walked the ramp in the Lakme Fashion week in 2008. She got her break in movies after being signed up by Salman Khan for his thriller Dabangg (2010)'),(13,'Akshara Haasan','/static/jtc/img/actress_akshara.jpg','Actress','Akshara Haasan is an actress, known for Shamitabh (2015), Laali Ki Shaadi Mein Laaddoo Deewana (2017) and Comedy Nights with Kapil (2013).'),(14,'Vivaan Shah','/static/jtc/img/actor_vivaan.jpg','Actor','Step cousin to Bollywood actor Shahid Kapur. Shahids step mother Supriya Pathak and Vivaans mother are sisters.\r\nSon of Bollywood actors Naseeruddin Shah and Ratna Pathak Shah.\r\nBrother of Bollywood actor/Musician Immaduddin Shah.\r\nGrandson of Bollywood actress Dina Pathak.\r\nNephew to Bollywood actors Pankaj Kapur and Supriya Pathak.\r\nGrand nephew of actress Tarla Mehta ( Dina Pathak\'s sister).\r\nVery close friend of Akshara Hassan.\r\nNephew of actor Salim Shah ( Dad\'s cousin).\r\nGrandfather Baldev Pathak use to stitch Rajesh Khanna\'s clothes . He was a very famous tailor.'),(15,'Kanan Gill','/static/jtc/img/actor_kanan.jpg','Actor','Kanan Gill is an actor and writer, known for Pretentious Movie Reviews (2014), Better Life Foundation (2016) and How Insensitive! By Kanan Gill (2016).');
